  "text" : "\"\u2026\uC2DC\uAC04\uC744 \uB4E4\uC5EC\uC11C\uB77C\uB3C4 \uCF54\uB07C\uB9AC\uC758 \uB2E4\uB9AC\uB97C \uB118\uC5B4 \uC804\uCCB4\uB97C \uC54C\uACE0\uC790 \uD558\uB294 \uC774\uB4E4\uACFC, \uC0AC\uBA85\uAC10\uC744 \uAC00\uC9C0\uACE0 \uADF8\uAC83\uC744 \uC54C\uB9AC\uB824\uB294 \uD504\uB85C\uD398\uC154\uB110, \uADF8 \uACFC\uC815\uC5D0\uC11C \uD6C8\uB828\uB418\uB294 \uAC00\uCE58\uD310\uB2E8\uC758 \uACF5\uAC04\uC774 \uD5C8\uBB34\uD558\uAC8C \uBB34\uB108\uC9C0\uC9C0 \uC54A\uAE30\uB97C \uBC14\uB780\uB2E4. \uADF8 \uACF5\uAC04\uC774 \uC5B8\uB860\uC774\uB4E0, \uBC95\uC815\uC774\uB4E0, \uAC1C\uC778\uC801\uC778 \uB9CC\uB0A8\uC774\uB4E0\u2026\"",
