  "text" : "\"\uC601\uAD6D\uC758 \uB9C8\uC774\uD074 \uBB34\uC5B4\uB77C \uBD88\uB9AC\uC6B0\uB294 \uB9C8\uCF00\uD305 \uC804\uBB38\uAC00 \uC870\uB098\uB2E8 \uAC00\uBCA0\uC774\uB294 \u2018\uB9C8\uCF00\uD305\uC758 \uAD50\uBB18\uD55C \uC2EC\uB9AC\uD559\u2019\uC774\uB77C\uB294 \uCC45\uC744 \uD1B5\uD574, \uC601\uD63C\uC744 \uD640\uB9AC\uB294 28\uAC00\uC9C0 \uBC29\uBC95\uC744 \uB098\uC5F4\uD558\uBA74\uC11C \uADF8 \uC911\uC758 \uD558\uB098\uB85C \uB9E5\uB77D\uC758 \uC81C\uAC70(contextomy)\uB97C \uB4E4\uC5C8\uB2E4.\"",
