  "text" : "\"\uC2A4\uB9C8\uD2B8\uD3F0\uC744 \uCF1C\uBA74 \uC2DC\uC2DC\uAC01\uAC01\uC73C\uB85C \uB728\uB294 \uC0AC\uAC74\uC0AC\uACE0 \uC591\uC0C1\uB3C4 \uD06C\uAC8C \uB2E4\uB974\uC9C0 \uC54A\uB2E4. \uC2DC\uAC04\uC774 \uB3C8\uC774\uB77C \uBC30\uC6E0\uC73C\uB2C8, \uC5C4\uCCAD\uB098\uAC8C \uACBD\uC81C\uC801\uC778 \uC2DC\uC2A4\uD15C\uC774 \uC544\uB2D0 \uC218 \uC5C6\uB2E4. \uADF8 \uC2DC\uC2A4\uD15C \uC18D\uC5D0\uC11C \uB204\uAD70\uAC00\uB294 \uD558\uB8E8\uC544\uCE68\uC5D0 \uC5F4\uC0AC\uAC00 \uB418\uACE0, \uB204\uAD70\uAC00\uB294 \uD68C\uBCF5\uC774 \uBD88\uAC00\uD558\uAC8C \uCC98\uCC38\uD788 \uC4F0\uB7EC\uC9C4\uB2E4.\"",
