  "text" : "\"\u2026\uCC98\uC74C\uBD80\uD130 \uB05D\uC744 \uC815\uC0C9\uD558\uACE0 \uC9C0\uCF1C\uBCFC \uC2DC\uAC04\uB3C4 \uC5EC\uB825\uB3C4 \uBCC4\uB85C \uC5C6\uB2E4. \uB300\uC2E0, \uC870\uAE08\uB9CC \uAE30\uB2E4\uB9AC\uBA74 \uD558\uC774\uB77C\uC774\uD2B8\uB85C \uD3B8\uC9D1\uB41C \uB3D9\uC601\uC0C1, \uC2E4\uC2DC\uAC04\uC5D0 \uAC00\uAE4C\uC6B4 \uB17C\uD3C9\uACFC \uADF8\uB098\uB9C8\uB3C4 \uC55E\uB4A4 \uC798\uB824\uC9C4 \uBA58\uD2B8, \uC790\uADF9\uC801 \uC790\uB9C9\uC774 \uB4A4\uB97C \uC787\uB294\uB2E4. \uADF8\uC5D0 \uC989\uAC01\uC801\uC73C\uB85C \uB2EC\uB9AC\uB294 \uC218\uBC31\uAC1C\uC758 \uB313\uAE00\uACFC \uC88B\uC544\uC694\uB294 \uB364\uC774\uB2E4.\"",
