  "text" : "\uD638\uD154 \uC9C1\uC6D0\uC774 \uC4F4\uC6C3\uC74C\uC744 \uC9D3\uB354\uB2C8 \uD639\uC2DC \uAE08\uBC29 \uB05D\uB098\uB294 \uC791\uC5C5\uC778\uC9C0, \uB530\uB85C \uD544\uC694\uD55C \uD504\uB85C\uADF8\uB7A8\uC740 \uC5C6\uB294\uC9C0 \uBB3B\uB354\uB77C. \uADF8\uB798\uC11C \uADF8\uB0E5 USB \uAF42\uC744 \uC218 \uC788\uACE0, \uC778\uD130\uB137\uB9CC \uC5F0\uACB0\uB418\uC5B4 \uC788\uC73C\uBA74 \uB41C\uB2E4\uACE0 \uD588\uB354\uB2C8 \uADF8\uB7FC \uD504\uB7F0\uD2B8\uC5D0 \uC788\uB294 \uC9C1\uC6D0\uC6A9 PC\uB97C \uC4F0\uB77C\uACE0 \uD574\uC11C, \uADF8\uAC78\uB85C \uB2E4\uD589\uD788 \uB0B4 \uC77C\uC740 \uD574\uACB0\uD568;",
