  "text" : "\uADF8\uB798\uC11C USB \uBA54\uBAA8\uB9AC\uB85C \uC7A0\uAE50 \uC791\uC5C5\uC744 \uD574\uC57C \uD558\uB294\uB370, \uB2E4\uB978 PC\uC5D0\uB294 USB \uD3EC\uD2B8\uAC00 \uC5C6\uB354\uB77C. \uADF8\uB798\uC11C \uB2D8\uC774 \uC9C0\uAE08 \uCC28\uC9C0\uD558\uACE0 \uC549\uC544\uC788\uB294 \uD37C.\uBE14.\uB9AD(\uAC15\uC870) PC \uC790\uB9AC\uAC00 \uBE44\uAE38 \uAE30\uB2E4\uB9AC\uACE0 \uC788\uB2E4\uACE0 \uD588\uC9C0. \uADF8\uB7AC\uB354\uB2C8 \uADFC\uB370 \uC65C \uC790\uAE30 \uB4A4\uC5D0 \uC788\uB0EC. \uC57C \uADF8\uB7FC \uB2C8 \uC606\uC5D0 \uC11C \uC788\uC744\uAE4C\u2026?",
