  "text" : "\uBB50\uB77C \uB9D0\uD558\uB098 \uC2F6\uC5B4\uC11C \uB4E4\uC5B4\uBD24\uB354\uB2C8, \uC65C \uC790\uAE30 \uB4A4\uC5D0 \uC788\uB0EC. \uADF8\uB798\uC11C \uCC98\uC74C\uC5D4 \uBB54 \uC18C\uB9B0\uAC00 \uC2F6\uC5B4\uC11C \uB124? \uC774\uB7AC\uB354\uB2C8, \uC65C \uC548\uAC00\uACE0 \uC790\uAE30 \uB4A4\uC5D0 \uC788\uB0D0\uB294\uAC70\uC57C. \uD639\uC2DC \uC9C0\uAE08 \uC790\uAE30 \uC2A4\uD1A0\uD0B9\uD558\uB0D0 \uBB50 \uC774\uB7F0 \uC18C\uB9AC \uD558\uBA74\uC11C. \uC5B4\uC774\uAC00 \uC5C6\uAE34 \uD574\uB3C4 \uB098\uB984 \uC608\uC758\uC788\uAC8C \uB300\uB2F5\uC744 \uD574\uC918\uC57C\uC9C0 \uBB58 \uC5B4\uCF00 \uD558\uACA0\uB0D0\u2026",
