  "text" : "\uC774 \uC5EC\uC131 1\uC778 BJ \uBC29\uC1A1 + \uC2A4\uD2B8\uB9AC\uBC0D \uC5C5\uCCB4\uB97C \uD1B5\uD55C \uC74C\uB780\uBB3C\uC758 \uC720\uD1B5\uAD6C\uC870\uAC00 \uC6CC\uB099 \uCEE4\uC9C0\uB2E4\uBCF4\uB2C8 \uC774\uAC78 \uC5B4\uB5BB\uAC8C \uB2E8\uC18D\uD560 \uAC83\uC778\uC9C0\uAC00 \uC55E\uC73C\uB85C\uC758 \uAD00\uC2EC\uC0AC. \uB2E8\uC21C\uD788 \uC2E0\uCCB4\uBD80\uC704 \uAC00\uBCCD\uAC8C \uB178\uCD9C\uD558\uB294 \uC815\uB3C4\uB8F0 \uB118\uC5B4 \uC774\uC81C\uB294 \uBC29\uC1A1\uC5D0\uC11C \uC131\uAD00\uACC4\uAE4C\uC9C0 \uD558\uACE0, \uACBD\uC7C1\uC744 \uC704\uD574 \uBBF8\uB07C\uB85C \uBAB0\uCE74 \uB4F1\uC744 \uBC30\uD3EC\uD558\uAE30\uB3C4",
