  "text" : "\uC800 \uD2B8\uC717\uC744 \uB9AC\uD2B8\uC717\uD55C \uB4A4 '\uADF8\uB7F0 \uD310\uD0C0\uC9C0\uAC00 \uBB50 \uC5B4\uB54C\uC11C? \uAC1C\uC88B\uC740\uB370?' \uB77C\uBA70 \uC5B4\uB9AC\uB465\uC808\uD574\uD558\uB294 \uC5EC\uD2B8\uCE5C\uB4E4 \uBC18\uC751\uC744 \uC778\uC6A9\uD558\uACE0 \uC2F6\uC740 \uB9C8\uC74C\uC774 \uAD74\uB69D\uAC19\uAE34 \uD55C\uB370, \uADF8\uB7F0 \uD2B8\uC717\uC744 \uB9AC\uD2B8\uC717\uD558\uBA74 \uADF8\uAC70 \uBCF4\uACE0 \uCAD3\uC544\uAC00\uC11C DM\uC73C\uB85C \uD5C9\uD5C9\uB300\uBA70 \uC81C\uAC00 \uD574\uB4DC\uB9B4\uAC8C\uC694~ \uC774\uB7EC\uBA74\uC11C \uBED8\uC9D3\uD560 \uB188\uB4E4\uB55C\uC5D0 \uD328\uC2A4\u2026\u314B;",
