  "text" : "\uBB50 \uBB3C\uB860 '\uB178\uCF58\uC9C8\uC2F8 \uC88B\uC544\uD558\uAC70\uB098 \uADF8\uB7F0 \uC139\uC2A4\uD310\uD0C0\uC9C0\uB97C \uAC00\uC9C4 \uC5EC\uC790\uB294 \uC5C6\uB2E4 \u2192 \uC544\uB2C8 \uBB50\uB0D0 \uB098\uB3C4 \uC5EC\uC790\uC9C0\uB9CC \uB178\uCF58\uC9C8\uC2F8 \uC88B\uC544\uD558\uACE0 \uADF8\uB7F0 \uC139\uC2A4\uD310\uD0C0\uC9C0 \uC788\uB294\uB370? \u2192 \uADF8\uAC74 \uB2C8\uAC00 \uCF54\uB974\uC14B\uC744 \uB4A4\uC9D1\uC5B4 \uC4F4 \uBA85\uC608\uC790\uC9C0 \uD55C\uB0A8\uBD80\uC5ED\uC790\uB77C \uADF8\uB7FC' \uC2DD\uC73C\uB85C \uC6CC\uD504\uD558\uB294 \uAC83\uC774 \uC694\uC998 \uD2B8\uC704\uD130 \uD2B8\uB80C\uB4DC\uC774\uAE34 \uD55C\uB370\u2026",
