  "text" : "\uD035\uCC28\uC9C0 3.0 \uC785\uCD9C\uB825\uC744 \uC9C0\uC6D0\uD558\uB294 \uC0E4\uC624\uBBF8\uC758 20,000mAh \uC678\uC7A5\uBC30\uD130\uB9AC 2\uC138\uB300(PLM05ZM)\uB97C \uAD6C\uC785. \uC65C \uAD6C\uC785\uC744 \uACE0\uBBFC\uD588\uC5C8\uB098 \uC2F6\uC744 \uC815\uB3C4\uB85C \uACE0\uC18D\uCDA9\uC804 \uC785\uCD9C\uB825 \uBAA8\uB450 \uC798 \uB418\uACE0, \uC791\uACE0 \uAC00\uBCCD\uB2E4. \uC6D0\uB798 \uBCF4\uC720\uD55C \uB3D9\uC77C\uC2A4\uD399 \uD0C0\uC0AC \uC678\uC7A5\uBC30\uD130\uB9AC\uC758 60~70% \uC815\uB3C4 \uD06C\uAE30\uC640 \uBB34\uAC8C https:\/\/t.co\/YI507utOXt",
